import React from "react";

function Footer() {
  return (
    <div>
      <footer className="footer mt-auto py-3">
        <div className="container">
          <span className="text-muted">Cactus shop @copyright</span>
        </div>
      </footer>
    </div>
  );
}
export default Footer;
